Pola hidup sehat adalah gaya hidup yang memperhatikan berbagai aspek kesehatan. Berikut adalah beberapa langkah untuk menerapkan pola hidup sehat:

- Makan Sehat: Konsumsi lebih banyak sayuran dan pilih camilan serta sumber protein yang lebih sehat. 

- Olahraga Rutin: Lakukan aktivitas fisik setiap hari untuk menjaga kebugaran. 

- Minum air putih minimal 2 liter perhari

- Kelola Stres: Hindari stres dengan cara yang bijak, seperti meditasi atau hobi. 

- Tidur Cukup: Pastikan mendapatkan tidur yang cukup setiap malam. 

- Hindari Kebiasaan Buruk: Berhenti merokok dan kurangi konsumsi alkohol. 

